Diagnosis.
Small, broad-headed 

Sarcohyla

(males 
28.5–32.2 mm
) with distinctly short snout, long fingers, long legs and head broader than body. Adult males to 
32.2 mm
SVL. Adult female size unknown. Eyes distinctly large, tympanum distinctly small (TW/SVL ratio 0.03), and snout short (END/HL ratio 0.23–0.27). Numerous tubercles beneath cloacal opening (
Fig. 5G
). Venter white with dark gray and brown marbling (
Figs. 2B
, 
4G, 4J
) and lacking any iridescent green coloration on dorsum (
Figs. 4A, 4D
). Comparisons with similar species, with character states of 

Sarcohyla toyota

in parenthesis: 

Sarcohyla thorectes

(
Figs. 4B, 4E
) differing by presence of iridescent green blotches on dorsum (complete absence of iridescent green; 
Figs. 4A, 4D
); white coloration with dark gray and brown marbling on anterior 60% of venter, including chest and abdomen, posterior 40% of venter flesh-colored (
Figs. 4H, 4K
) (white or yellow coloration with dark gray and brown marbling on 100% of venter, no flesh colored skin present; 
Figs. 4G, 4J
); distinct rostral keel present (
Fig. 5A
) (rostral keel absent; 
Fig. 5B
); dark brown markings on face and flank not continuous, not forming mask (
Fig. 5E
)(dark brown markings and face and flank continuous, forming mask; 
Fig. 5D
); tympanum distinct,>26% of ED (tympanum indistinct, ≤23% of ED); nostrils slightly protruding, head bluntly rounded in dorsal profile (
Fig. 5B
) (nostrils greatly protruding, head distinctly truncate in dorsal profile; 
Fig. 5A
); lateral profile of snout rounded (lateral profile of snout distinctly truncate); yellow ventral coloration completely lacking or limited (
Figs. 4H, 4K
) (varying amounts of yellow ventral coloration present on throat, chest, sides of abdomen, thighs and feet; 
Figs. 4G, 4J
); superarticular tubercles on first phalange of fingers on hand conical or barely bifid (superarticular tubercles on first phalange of fingers hand distinctly bifid); tarsal fold distinct (tarsal fold indistinct or absent); subarticular tubercles on foot conical (subarticular tubercles on foot slightly bifid); outer metatarsal tubercle absent or indistinct (outer metatarsal tubercle distinct). 

Sarcohyla toyota

further differs from 

S. thorectes

by following mensural proportions (values for 

S. thorectes

given in parenthesis): longer hand, HA/SVL ratio 0.32–0.37 (0.27–0.33); smaller tympanum, TW/SVL ratio in males 
0.027
–0.029
(
0.035
–0.039
); larger eye ED/SVL ratio 0.13–0.14 (0.12–0.13); lower TW/ED ratio in males 0.20–0.23 (0.27–0.32); shorter snout END/HL ratio 0.23–0.27 (0.27–0.29). 

Sarcohyla hazelae

differing by (values for 

S. toyota

given in parenthesis): larger body size in males 35.0– 
38.8 mm
SVL (
28.5–32.2 mm
SVL); inmaculate white venter (

Figs. 
4I
, 4L

) (white or yellow background with dark gray and brown marbling on 100% of venter; 
Figs. 4H, 4K
